
  document.getElementById("quizForm").addEventListener("submit", function(event) {
    event.preventDefault(); // impede o envio padrão

    let score = 0;
    let total = 20; // total de pontos possíveis

    // Gabarito de exemplo:
    const respostas = {
      q1: "c",
      q2: "c",
      q3: "a",
      q4: "b",
      q5: "c",
      q6: ["a", "c", "e"],
      q7: ["a", "b", "d"],
      q8: ["a", "b", "c", "d"],
      q9: ["a", "b", "e"],
      q10: ["a", "b", "c"],
      q11_1: "F",
      q11_2: "V",
      q11_3: "F",
      q11_4: "F",
      q11_5: "V",
      q11_6: "F",
      q11_7: "V",
      q11_8: "F",
      q11_9: "V",
      q11_10: "F"
    };

    // Questões de única escolha
    for (let i = 1; i <= 5; i++) {
      const resposta = document.querySelector(`input[name="q${i}"]:checked`);
      if (resposta && resposta.value === respostas[`q${i}`]) {
        score++;
      }
    }

    // Questões de múltipla seleção
    for (let i = 6; i <= 10; i++) {
      const marcadas = Array.from(document.querySelectorAll(`input[name="q${i}"]:checked`)).map(cb => cb.value).sort();
      const corretas = respostas[`q${i}`].sort();
      if (JSON.stringify(marcadas) === JSON.stringify(corretas)) {
        score++;
      }
    }

    // Questões verdadeiro ou falso
    for (let i = 1; i <= 10; i++) {
      const resposta = document.querySelector(`input[name="q11_${i}"]:checked`);
      if (resposta && resposta.value === respostas[`q11_${i}`]) {
        score++;
      }
    }

    // Pedir nome do aluno
    const nomeAluno = prompt("Digite seu nome completo:");

    // Gerar o PDF com a mensagem personalizada
    if (nomeAluno) {
      const { jsPDF } = window.jspdf;
      const doc = new jsPDF();

      // Adicionar imagem (URL ou base64 da imagem)
      const img = 'data:image/png;base64,'; // Substitua pelo caminho da sua imagem
      doc.addImage(img, 'PNG', 10, 50, 50, 50); // Adiciona a imagem com coordenadas x=10, y=10, largura=50 e altura=50

      // Adicionar título centralizado em negrito
      doc.setFontSize(22);
      doc.setFont("helvetica", "bold");
      const textoTitulo = `Parabéns, ${nomeAluno}!`;
      doc.text(textoTitulo, doc.internal.pageSize.width / 2 - doc.getStringUnitWidth(textoTitulo) * doc.internal.scaleFactor / 2, 70);

      // Adicionar resultado centralizado
      const textoResultado = `Você acertou ${score} de ${total} questões.`;
      doc.setFontSize(16);
      doc.setFont("helvetica", "normal");
      doc.text(textoResultado, doc.internal.pageSize.width / 2 - doc.getStringUnitWidth(textoResultado) * doc.internal.scaleFactor / 2, 90);

      // Salvar o PDF com o nome do aluno
      doc.save(`${nomeAluno}_resultado.pdf`);
    }
  });
